import {NavLink} from "react-router-dom"
import styles from "./Navbar.module.css"

export default function Navbar(){
    return(
        <nav className={styles.nav}>
            <ul>
                <li><NavLink  className={styles.nav_links} to="/">Home</NavLink></li>
                <li><NavLink  className={styles.nav_links} to="/characters">Characters</NavLink></li>
                <li><NavLink className={styles.nav_links} ></NavLink></li>
            </ul>
        </nav>
    )
}
